import React from "react";
import classes from './TimerSection.module.css'

const TimerSection = (props) => {
  return (
    <div className={classes.timerSectionDiv}>
      <div className={classes.timerSettings}>timer settings</div>
      <div className={classes.timerContainer}>timer here</div>
    </div>
  );
};

export default TimerSection;
